import { Component } from '@angular/core';

@Component({
  selector: 'app-registration',
  templateUrl: './registration.component.html',
  styleUrls: ['./registration.component.css']
})
export class RegistrationComponent {

  Email!:string;
  UserName!:string;
  PhoneNumber!:number;
  Password!:string;

  register(){
    alert("user registration successfull");
  }

}
<p>registration works!</p>
<table border="5" [cellPadding]="5" [cellSpacing]="5">
    <tr><td><label>Enter your username <input type="text" [(ngModel)]="UserName"></label></td></tr>
    <tr><td><label>Enter your Email Id <input type="text" [(ngModel)]="Email"></label></td></tr>
    <tr><td><label>Enter your Phone Number <input type=number [(ngModel)]="PhoneNumber"></label></td></tr>
    <tr><td><label>Set Password<input type="text" [(ngModel)]="Password"></label></td></tr>

</table>
<div>
    <button (click)="register()">Register</button>

</div>
